function InitApp(n,t,i,r){const u=Vue.createApp({data(){return{blocks:[],editable:r}},components:{BlocksEditor},methods:{getBlocks(){_yemon[t].service.getData("/GetItem",{name:"blockscontent:"+i},n=>{this.blocks=[],n.data&&(this.blocks=JSON.parse(n.data)),this.$forceUpdate()},n=>{toastr.error("Erreur : "+n.response.data)})},changed(n){n&&_yemon[t].service.postData("/SetItem",{name:"blockscontent:"+i,value:JSON.stringify(n),keephistory:!1},()=>{},n=>{toastr.error("Erreur : "+n.response.data)})}},mounted(){this.getBlocks()}});u.component("cropper",VueAdvancedCropper.Cropper);u.mount("#"+n)}